import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";

const ViewTenant = () => {
  const { tenant_id } = useParams();
  const navigate = useNavigate();
  const [tenant, setTenant] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchTenant = async () => {
      try {
        const res = await fetch(
          `http://localhost:5000/view_tenant/${tenant_id}`,
          { credentials: "include" }
        );
        const data = await res.json();
        if (res.ok && data.success) setTenant(data.tenant);
        else alert(data.message || "Tenant not found");
      } catch (err) {
        console.error(err);
        alert("Error fetching tenant");
      } finally {
        setLoading(false);
      }
    };

    fetchTenant();
  }, [tenant_id]);

  if (loading) return <p>Loading tenant details...</p>;
  if (!tenant) return <p>Tenant not found</p>;

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: 20 }}>
      <h2 style={{ textAlign: "center", background: "#273c75", color: "white", padding: 15, borderRadius: 6 }}>
        Tenant Details
      </h2>

      <button
        onClick={() => navigate(-1)}
        style={{
          marginTop: 20,
          backgroundColor: "#7f8c8d",
          color: "#fff",
          padding: "8px 12px",
          border: "none",
          borderRadius: 6,
          cursor: "pointer",
        }}
      >
        ‚Üê Back
      </button>

      <div style={{ marginTop: 20 }}>
        <p><strong>Tenant Name:</strong> {tenant.tenantname}</p>
        <p><strong>DOB:</strong> {tenant.tendantob?.slice(0, 10)}</p>
        <p><strong>Nationality:</strong> {tenant.tenantnationality}</p>
        <p><strong>Email:</strong> {tenant.tenantemailid}</p>
        <p><strong>Mobile:</strong> {tenant.tenantmobilenumber}</p>
        <p><strong>Employer:</strong> {tenant.tenantemployer}</p>
        <p><strong>Lease:</strong> {tenant.leasestartdate?.slice(0, 10)} ‚Üí {tenant.leaseenddate?.slice(0, 10)}</p>
        <p><strong>Rent:</strong> {tenant.rentamount}</p>
        <p><strong>Deposit:</strong> {tenant.depositamountreceived}</p>

        <h4 style={{ marginTop: 20 }}>Documents</h4>
        {tenant.passportcopypath && (
          <p>
            <a href={`data:application/pdf;base64,${tenant.passportcopypath}`} target="_blank" rel="noreferrer">
              üìÑ Passport Copy
            </a>
          </p>
        )}
        {tenant.eidcopypath && (
          <p>
            <a href={`data:application/pdf;base64,${tenant.eidcopypath}`} target="_blank" rel="noreferrer">
              üìÑ EID Copy
            </a>
          </p>
        )}
      </div>
    </div>
  );
};

export default ViewTenant;
